import React from "react";
import Navbar from "../../components/navbar/Navbar";

export default function ViewStudent() {
  return (
    <>
      <Navbar />
      <div className="container-fluid p-5" style={{ backgroundColor: "#f7f7fa" }}>
        <div className="mx-auto bg-white border rounded mt-5" style={{ width: "30%" }}>
          <div style={{ height: "80px", background: "grey" }}></div>
          <div className="" style={{ height: "300px", textAlign: "center" }}>
            <p>Name: Alex Thomas</p>
          </div>
        </div>
      </div>
    </>
  );
}
